import React from 'react'
import {useAuth0} from '@auth0/auth0-react'

const Profile = () => {

    const { user } = useAuth0();

    return (
        <div>
            {JSON.stringify(user, null, 2)}
            {user.map}
        </div>
    )
}

export default Profile
